settings.custom_css_free_form:
ul.et_pb_tabs_controls {
    background-color: transparent;
}
/* Vertikálne zobrazenie záložiek */
.et_pb_tabs_controls {
    display: flex;
    flex-direction: column;
    width: 30%; /* Môžete upraviť podľa potreby */
    float: left;
}

.et_pb_tabs_controls li {
    width: 100%;
    margin-bottom: 5px;
}

.et_pb_all_tabs {
    width: 70%; /* Môžete upraviť podľa potreby */
    float: right;
}

/* Vyčistenie floatov */
.et_pb_tabs:after {
    content: "";
    display: table;
    clear: both;
}

/* Responzívny dizajn pre mobilné zariadenia */
@media (max-width: 768px) {
    .et_pb_tabs_controls,
    .et_pb_all_tabs {
        width: 100%;
        float: none;
    }

    .et_pb_tabs_controls {
        margin-bottom: 20px;
    }
}
